import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Paper, Grid, Button, CssBaseline, Container, CardContent, CardMedia, Typography } from '@material-ui/core';
import Data from '../data.json'
import "./Ventas.css"


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper_prim: {
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette,
    },

    paper_sec: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    media: {
        height: 200,
    },
}));

export default function CenteredGrid() {
    const classes = useStyles();
    return (

        <div className={classes.root}>
            <React.Fragment>
                <CssBaseline />
                <Container fixed>
                    <Grid container spacing={3}>
                        <Grid item xs={12}>
                            <Paper className={classes.paper_prim}>
                                <h1>Propiedades en Venta</h1>
                            </Paper>                       
                        </Grid>
                        {Data.map(post => {
                            return (
                                <>
                        <Grid item xs={4}>
                            <Paper className={classes.paper_sec}>

                                            <CardMedia
                                                className={classes.media}
                                                image={ post.imgBanner}
                                                title="Contemplative Reptile"
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="h2">
                                                    {post.tittle}
                                    </Typography>
                                                <Typography variant="body2" color="textSecondary" component="p">
                                                    {post.smallContent}
                                    </Typography>
                                            </CardContent>
                                            <Button variant="contained" color="primary">
                                                Ver Propiedad
                                 </Button>





                            </Paper>
                                    </Grid>
                                </>
                            )
                        })}

                    </Grid>
                </Container>
            </React.Fragment>
        </div>
    );
}
